(101, 1, '2016-04-23 13:20:39', '2016-04-23 13:20:39', '<strong>Mobifone triển khai chương trình khuyến mãi nạp thẻ tặng 50% cho thuê bao trả trước trên toàn quốc trong tháng 4/2016</strong>\r\n\r\n1. Thời gian áp dụng: Từ 0h00 đến 24h00 ngày 16/4/2016\r\n\r\n2. Phạm vi đối tượng: Tất cả các thuê bao di động trả trước trên toàn quốc của Mobifone\r\n\r\n- Các thuê bao trả trước ( thuê bao đang hoạt động, khóa 1 chiều, khóa 2 chiều)\r\n\r\n- Thuê bao Fastconnect trả trước: không được áp dụng\r\n\r\n3. Nội dung tin khuyến mại Mobifone:\r\n\r\n- Tặng 50% mệnh giá nạp tiền vào tài khoản khuyến mại cho tất cả các loại thuê bao trả trước ( mức giá sau khuyến mại tương đương giảm giá 33%). Không giới hạn nạp tiền và mệnh giá nạp.\r\n\r\n- Mức tặng 50% được áp dụng cho tất cả các lần nạp trong thời gian khuyến mại theo tỷ lệ cụ thể : 25% khuyến mại vào tài khoản KM1 và 25% khuyến mại vào tài khoản KM2.\r\n\r\n- Tặng 100% ngày sử dụng đối với thuê bao MobiCard, Mobi365, MobiZone.\r\n\r\nLưu ý: Số tiền khuyến mại không dùng được cho dịch vụ data.\r\n\r\nKhi Nạp thẻ, Mua thẻ điện thoại trên Vienthong.com.vn khách hàng vừa được hưởng CHIẾT KHẤU 3% vừa được hưởng Khuyến mãi của nhà mạng Mobifone\r\n\r\n<img class="alignnone size-medium wp-image-102" src="http://annhien.me/wp-content/uploads/2016/04/6_1460601209_mobi_560x292-300x156.jpg" alt="6_1460601209_mobi_560x292" width="300" height="156" />', 'Mobifone khuyến mãi nạp thẻ tặng 50% cho thuê bao trả trước ngày 16-4', '', 'publish', 'open', 'open', '', 'mobifone-khuyen-mai-nap-tang-50-cho-thue-bao-tra-truoc-ngay-16-4', '', '', '2016-04-23 13:22:09', '2016-04-23 13:22:09', '', 0, 'http://annhien.me/?p=101', 0, 'post', '', 0),
