(103, 1, '2016-04-23 13:20:39', '2016-04-23 13:20:39', '<strong>Mobifone triển khai chương trình khuyến mãi nạp thẻ tặng 50% cho thuê bao trả trước trên toàn quốc trong tháng 4/2016</strong>\r\n\r\n1. Thời gian áp dụng: Từ 0h00 đến 24h00 ngày 16/4/2016\r\n\r\n2. Phạm vi đối tượng: Tất cả các thuê bao di động trả trước trên toàn quốc của Mobifone\r\n\r\n- Các thuê bao trả trước ( thuê bao đang hoạt động, khóa 1 chiều, khóa 2 chiều)\r\n\r\n- Thuê bao Fastconnect trả trước: không được áp dụng\r\n\r\n3. Nội dung tin khuyến mại Mobifone:\r\n\r\n- Tặng 50% mệnh giá nạp tiền vào tài khoản khuyến mại cho tất cả các loại thuê bao trả trước ( mức giá sau khuyến mại tương đương giảm giá 33%). Không giới hạn nạp tiền và mệnh giá nạp.\r\n\r\n- Mức tặng 50% được áp dụng cho tất cả các lần nạp trong thời gian khuyến mại theo tỷ lệ cụ thể : 25% khuyến mại vào tài khoản KM1 và 25% khuyến mại vào tài khoản KM2.\r\n\r\n- Tặng 100% ngày sử dụng đối với thuê bao MobiCard, Mobi365, MobiZone.\r\n\r\nLưu ý: Số tiền khuyến mại không dùng được cho dịch vụ data.\r\n\r\nKhi Nạp thẻ, Mua thẻ điện thoại trên Vienthong.com.vn khách hàng vừa được hưởng CHIẾT KHẤU 3% vừa được hưởng Khuyến mãi của nhà mạng Mobifone\r\n\r\n<img class="alignnone size-medium wp-image-102" src="http://annhien.me/wp-content/uploads/2016/04/6_1460601209_mobi_560x292-300x156.jpg" alt="6_1460601209_mobi_560x292" width="300" height="156" />', 'Mobifone khuyến mãi nạp thẻ tặng 50% cho thuê bao trả trước ngày 16-4', '', 'inherit', 'closed', 'closed', '', '101-revision-v1', '', '', '2016-04-23 13:20:39', '2016-04-23 13:20:39', '', 101, 'http://annhien.me/101-revision-v1/', 0, 'revision', '', 0),
(105, 1, '2016-04-23 13:23:18', '2016-04-23 13:23:18', '– Thời gian khuyến mãi: Duy nhất 1 ngày 22/04/2016.\r\n\r\n– Phạm vi triển khai: Toàn quốc.\r\n\r\n– Đối tượng áp dụng: Các thuê bao Viettel trả trước đang hoạt động 2 chiều thuộc danh sách khuyến mãi của nhà mạng hoặc nhận được tin nhắn mời tham gia chương trình từ hệ thống.\r\n<div id="attachment_11763" class="wp-caption aligncenter"><a href="http://dichvumobile.vn/wp-content/uploads/2016/04/viettel-khuyen-mai-100-gia-tri-the-nap-ngay-22042016.jpg"><img class="size-full wp-image-11763" src="http://dichvumobile.vn/wp-content/uploads/2016/04/viettel-khuyen-mai-100-gia-tri-the-nap-ngay-22042016.jpg" alt="Viettel khuyến mãi 100% giá trị thẻ nạp ngày 22/04/2016" width="600" height="600" /></a>\r\n<p class="wp-caption-text">Khách hàng Viettel nhận được tin nhắn trong hôm nay hãy nhanh tay nạp thẻ để được tặng 100% giá trị thẻ nạp nhé</p>\r\n\r\n</div>\r\n<h3><strong>Ưu đãi hấp dẫn khi tham gia nạp thẻ ngày 22/04:</strong></h3>\r\nKhách hàng thuộc đối tượng khuyến mãi của chương trình nạp thẻ trong hôm nay sẽ được tặng đến 100% giá trị thẻ nạp từ Viettel. Đặc biệt, ưu đãi này được sử dụng như sau:\r\n\r\n– Cộng 100% giá trị thẻ nạp vào tài khoản khuyến mãi dùng để <a href="http://dichvumobile.vn/cac-goi-khuyen-mai-goi-noi-mang-cua-viettel.html">gọi thoại nội mạng</a>, <a href="http://dichvumobile.vn/cac-goi-cuoc-khuyen-mai-tin-nhan-noi-mang-viettel.html">nhắn tin nội mạng</a> và truy cập internet.\r\n\r\n– Ưu đãi từ chương trình có thời hạn sử dụng trong 30 ngày kể từ ngày cộng tiền.\r\n\r\n– Tiền khuyến mãi được cộng vào tài khoản của thuê bao trong 2 ngày 23 và 24/04.\r\n\r\nLâu lắm rồi Viettel mới lại có một chương trình khuyến mãi 100% giá trị thẻ nạp như thế này phải không? Thuê bao nào may mắn thì hãy đừng bỏ lỡ mà nhanh tay nạp thẻ ngay để tài khoản luôn được dồi dào nhé.\r\n\r\nTrường hợp đợi lâu vẫn không thấy tin nhắn từ Viettel, khách hàng hãy soạn tin: <strong>KM</strong> gửi <strong>266</strong> để kiểm tra xem thuê bao đang dùng có thuộc danh sách <a href="http://dichvumobile.vn/khuyen-mai-viettel">khuyến mãi của Viettel</a> không nhé.\r\n\r\nVới mức khuyến mãi này, các thuê bao tha hồ gọi điện, nhắn tin với người thân, bạn bè, đặc biệt còn được dùng tài khoản khuyến mãi để truy cập internet nữa, quá tiện ích phải không nào?\r\n\r\nĐừng quên kiểm tra điện thoại để đợi tin nhắn từ Viettel và nạp thẻ thật nhiều để tiêu xài thả ga từ nay cho đến kỳ nghỉ lễ nhé. Chúc quý khách may mắn, thông tin về chương trình, quý khách vui lòng gọi <strong><a href="http://dichvumobile.vn/so-tong-dai-viettel.html">tổng đài Viettel</a> 198</strong> để biết thêm chi tiết.\r\n<div></div>\r\n<div></div>\r\n<div id="snippet-box">\r\n<div class="snippet-title">Thông tin</div>\r\n</div>', 'Viettel khuyến mãi 100% thẻ nạp ngày 22/4 theo danh sách:', '', 'publish', 'open', 'open', '', 'viettel-khuyen-mai-100-nap-ngay-224-theo-danh-sach', '', '', '2016-04-24 02:21:38', '2016-04-24 02:21:38', '', 0, 'http://annhien.me/?p=105', 0, 'post', '', 0),
(106, 1, '2016-04-23 13:23:10', '2016-04-23 13:23:10', '', 'viettel-khuyen-mai-100-gia-tri-the-nap-ngay-22042016', '', 'inherit', 'open', 'closed', '', 'viettel-khuyen-mai-100-gia-tri-the-nap-ngay-22042016', '', '', '2016-04-23 13:23:10', '2016-04-23 13:23:10', '', 105, 'http://annhien.me/wp-content/uploads/2016/04/viettel-khuyen-mai-100-gia-tri-the-nap-ngay-22042016.jpg', 0, 'attachment', 'image/jpeg', 0),
