(196, 1, '2016-04-28 13:53:44', '2016-04-28 13:53:44', '<h3 style="text-align: center;"><strong><span style="color: #00a9e0;">CHƯƠNG TRÌNH KHUYẾN MÃI</span></strong>\r\n<strong><span style="color: #00a9e0;"> ĐĂNG KÝ SIM VINAPHONE TRẢ SAU GỌI MIỄN PHÍ</span></strong></h3>\r\n<p style="text-align: center;"><strong> <span style="color: #000080;">Thỏa sức Alô - Không tính tiền cho cuộc gọi dưới 10 phút</span></strong>\r\n<strong> Hotline : <span style="color: #ff0000;">0917.577.599 - 0919.672.679</span></strong>\r\n<strong> - gặp Mrs. Ngân để được tư vấn và đăng ký số</strong>\r\n<strong> Giao sim miễn phí tận nơi trong khu vực Tp.Hồ Chí Minh</strong>\r\n<span style="color: #000000; font-size: 11px;"><strong> Hỗ trợ giảm phí hòa mạng cho Doanh Nghiệp, Công ty đăng ký trên 3 sim</strong></span>\r\n<span style="color: #000000; font-size: 11px;"> <strong> (xem chi tiết bên dưới)</strong></span></p>\r\n\r\n<h4><span style="color: #0000ff;"><strong>1. CHƯƠNG TRÌNH LÀM SIM VINAPHONE GỌI 3 MẠNG DÀNH CHO CÁ NHÂN:</strong></span></h4>\r\n<img class="wp-image-197 aligncenter" src="http://khosimsodepgiare.com/wp-content/uploads/2016/04/km-300x227.jpg" alt="km" width="652" height="493" />\r\n<h4><span style="color: #0000ff;"><strong>2. CHƯƠNG TRÌNH LÀM SIM VINAPHONE TRẢ SAU DÀNH CHO DOANH NGHIỆP:</strong></span></h4>\r\n<img class="wp-image-198 aligncenter" src="http://khosimsodepgiare.com/wp-content/uploads/2016/04/km2-300x212.png" alt="km2" width="650" height="459" />\r\n<h4><span style="color: #0000ff;"><strong>3. THỦ TỤC</strong></span></h4>\r\n<p style="text-align: justify;"><strong> + Cá nhân : photo chứng minh nhân dân và hộ khẩu không cần công chứng, không phân biệt tỉnh thành.</strong>\r\n<strong> + Doanh nghiệp : Giấy phép đăng ký kinh doanh photo (có thể không cần công chứng)</strong>\r\n<strong> Người đại diện pháp luật của Doanh nghiệp ký tên đóng dấu trên hợp đồng. Nếu người ký tên trên hợp đồng không phải là đại diện pháp luật của doanh nghiệp (giám đốc, chủ doanh nghiệp....) thì phải có giấy ủy quyền được ký tên đóng dấu của người đại diện pháp luật.</strong></p>\r\n\r\n<h4><span style="color: #0000ff;"><strong>4. ĐIỀU KIỆN ĐĂNG KÍ</strong></span></h4>\r\n<p style="text-align: justify;"><strong> + Mỗi cá nhân chỉ được hòa mạng tối đa 10 sim (đối với CMND được cấp tại Tp.HCM) hoặc 05 sim (đối với CMND được cấp ở tỉnh thành khác).</strong>\r\n<strong> + CMND không bị nợ cước trên hệ thống của Vinaphone.</strong>\r\n<strong><span style="color: #ff0000;">ĐẶC BIỆT:</span> Giao sim và làm thủ tục tận nơi trên toàn khu vực thuộc TP.HCM</strong></p>', 'CHƯƠNG TRÌNH KHUYẾN MÃI CHO THUÊ BAO VINAPHONE TRẢ SAU', '', 'publish', 'open', 'open', '', 'khuyen-mai-sim-vina-tra-sau', '', '', '2016-04-28 15:07:07', '2016-04-28 15:07:07', '', 0, 'http://khosimsodepgiare.com/?p=196', 0, 'post', '', 0),
